33.body:
{ "type": "METADATA", "fields": { "media_id": "0DgeZjJtJ8EC", "caption": "Eine Statue der Justitia mit einer Waage und einem Schwert in ihren Händen.", "frame_capture:url": "https://example.com/thumbnails/thumb.0000031.jpg", "frame_capture:numerator": "1", "frame_capture:denominator": "5" }
} field description media_id alpha-numeric CMS id of the media caption the video's caption frame_capture:url if frame capture was enabled during transcoding, this is the URL of the last frame capture frame_capture:numerator frame capture images are numerated, starting at 0000000 which can be used as the poster image. frame_capture:denominator numerator and denominator can be used to to calculate which frame capture image must be displayed at a given time. Example: for numerator=1 and denominator=5, we have to increment the frame capture every 5 / 1 == 5 seconds: 00:00.000 --> 00:05.000
/thumbnails/thumb.0000000.jpg 00:05.000 --> 00:10.000
/thumbnails/thumb.0000001.jpg 00:10.000 --> 00:15.000
/thumbnails/thumb.0000002.jpg 00:15.000 --> 00:20.000
/thumbnails/thumb.0000003.jpg ... [~]

87.body:
// query multiple articles
message ListArticlesResponse { repeated stroeer.core.v1.Article articles = 1; string next_page_token = 2;
} Field name Type Description articles Article list of articles that match the query and also the filter, otherwise empty. next_page_token string A token that can be sent as page_token to retrieve the next page. If this field is omitted, there are no subsequent pages. [~]
